import React from 'react';
import Navbar from '../Home/Navbar';
import ProductPage from './ProductsPage';
import Footer from '../Home/Footer';

const Products = () => {
    return (
        <>
            <Navbar />
            <ProductPage />
            <Footer />
        </>
    )
}

export default Products;
